(1, 'Introduction', 'Germany is a Western European country with a landscape of forests, rivers, mountain ranges and North Sea beaches. It has over 2 millennia of history. Berlin, its capital, is home to art and nightlife scenes, the Brandenburg Gate and many sites relating to WWII. Munich is known for its Oktoberfest and beer halls, including the 16th-century Hofbräuhaus. Frankfurt, with its skyscrapers, houses the European Central Bank.', 'Einführung', 'Deutschland ist ein westeuropäisches Land mit einer Landschaft aus Wäldern, Flüssen, Gebirgszügen und Nordseestränden. Es hat über 2 Jahrtausende Geschichte. Die Hauptstadt Berlin beherbergt Kunst- und Ausgehviertel, das Brandenburger Tor und viele Orte rund um den Zweiten Weltkrieg. München ist bekannt für sein Oktoberfest und seine Bierhallen, darunter das Hofbräuhaus aus dem 16. Jahrhundert. Frankfurt mit seinen Wolkenkratzern beherbergt die Europäische Zentralbank.', 'Introduction', 'L\'Allemagne est un pays d\'Europe occidentale avec un paysage de forêts, de rivières, de chaînes de montagnes et de plages de la mer du Nord. Il a plus de 2 millénaires d\'histoire. Berlin, sa capitale, abrite des scènes d\'art et de vie nocturne, la porte de Brandebourg et de nombreux sites liés à la Seconde Guerre mondiale. Munich est connue pour son Oktoberfest et ses brasseries, y compris le Hofbräuhaus du XVIe siècle. Francfort, avec ses gratte-ciel, abrite la Banque centrale européenne.'),
(2, 'Tourism', 'Germany is the seventh most visited country in the world, with a total of 407 million overnights during 2012. This number includes 68.83 million nights by foreign visitors. In 2012, over 30.4 million international tourists arrived in Germany. Berlin has become the third most visited city destination in Europe. Additionally, more than 30% of Germans spend their holiday in their own country, with the biggest share going to Mecklenburg-Vorpommern.', 'Tourismus', 'Deutschland ist das siebthäufigste Land der Welt mit insgesamt 407 Millionen Übernachtungen im Jahr 2012. In dieser Zahl sind 68,83 Millionen Übernachtungen ausländischer Besucher enthalten. Im Jahr 2012 kamen über 30,4 Millionen internationale Touristen nach Deutschland. Berlin ist das dritthäufigste Reiseziel in Europa. Darüber hinaus verbringen mehr als 30% der Deutschen ihren Urlaub im eigenen Land, wobei der größte Anteil nach Mecklenburg-Vorpommern geht.', 'Tourisme', 'L\'Allemagne est le septième pays le plus visité au monde, avec un total de 407 millions de nuitées en 2012. Ce nombre comprend 68,83 millions de nuitées de visiteurs étrangers. En 2012, plus de 30,4 millions de touristes internationaux sont arrivés en Allemagne. Berlin est devenue la troisième ville la plus visitée d\'Europe. En outre, plus de 30% des Allemands passent leurs vacances dans leur propre pays, la plus grande part allant au Mecklembourg-Poméranie.'),
(3, 'Motorsports', 'Germany is one of the leading motor sports countries in the world. Constructors like BMW and Mercedes are prominent manufacturers in motor sport. Porsche has won the 24 Hours of Le Mans race 19 times and Audi 13 times. Michael Schumacher has set many motor sport records during his career, having won seven Formula One World Drivers Championships, more than any other.', 'Motorsport', 'Deutschland ist eines der führenden Motorsportländer der Welt. Konstrukteure wie BMW und Mercedes sind namhafte Hersteller im Motorsport. Porsche hat das 24-Stunden-Rennen von Le Mans 19-mal und Audi 13-mal gewonnen. Michael Schumacher hat in seiner Karriere viele Motorsport-Rekorde aufgestellt und wie kein anderer sieben Formel-1-Fahrer-Weltmeisterschaften gewonnen.', 'Sports motorisés', 'L\'Allemagne est l\'un des principaux pays du monde du sport automobile. Les constructeurs comme BMW et Mercedes sont des fabricants de premier plan dans le sport automobile. Porsche a remporté les 24 Heures du Mans 19 fois et l\'Audi 13 fois. Michael Schumacher a établi de nombreux records au cours de sa carrière dans le sport automobile, après avoir remporté sept championnats du monde de Formule 1, plus que tout autre.'),
(4, 'Cuisine', 'German cuisine varies from region to region and often neighbouring regions share some culinary similarities. Bread is a significant part of German cuisine and German bakeries produce about 600 main types of bread and 1,200 different types of pastries and rolls. German cheeses account for about a third of all cheese produced in Europe. Germans produce their ubiquitous sausages in almost 1,500 varieties, including Bratwursts and Weisswursts.', 'Küche', 'Die deutsche Küche variiert von Region zu Region, und oft haben die Nachbarregionen einige kulinarische Gemeinsamkeiten. Brot ist ein wesentlicher Bestandteil der deutschen Küche, und in deutschen Bäckereien werden etwa 600 Hauptsorten Brot und 1.200 verschiedene Arten von Gebäck und Brötchen hergestellt. Rund ein Drittel der europäischen Käseproduktion entfällt auf deutschen Käse. Die Deutschen stellen ihre allgegenwärtigen Würste in fast 1.500 Sorten her, darunter Bratwürste und Weißwürste.', 'Cuisine', 'La cuisine allemande varie d\'une région à l\'autre et les régions voisines partagent souvent des similitudes culinaires. Le pain représente une part importante de la cuisine allemande et les boulangeries allemandes produisent environ 600 types de pain principaux et 1 200 types de pâtisseries et de petits pains différents. Les fromages allemands représentent environ un tiers de tous les fromages produits en Europe. Les Allemands produisent leurs saucisses omniprésentes dans près de 1 500 variétés, notamment des Bratwurst et des Weisswurst.'),
(5, 'Currency', 'One US Dollar = Seventy One INR', 'Währung', 'Ein Euro = Neun-und-siebzig INR', 'Moneda', 'Un euro = Soixante-dix-neuf INR');

